蔡榮興藝師自行開發的木雕智慧型手機殼，長：15公分、寬：8公分、高：2公分、打開最寬：16公分，以實木為材質，於2013年完成，目前存放在宜蘭市東後街94號 蔡榮興雕刻社櫥窗內。 「蔡榮興雕刻社」原本位於北門口，地址為宜蘭市舊城北路132號，今年初搬到宜蘭市東興街94號自宅。蔡榮興是宜蘭木雕藝師，人稱「榮興師」，功夫承襲家業，精通各式木雕，手藝已達爐火純青，尤其在傳統粿印、餅印等雕刻功夫，更是聲名遠播。近年更雕刻了不少的創意作品，如手機殼、海綿寶寶、木布鞋、木拖鞋等，作工細膩有趣，令人拍案叫絕。而月兔智慧型手機殼雕工細緻，獨一無二的造型，精巧又可愛，讓使用者手感跟著雕刻紋路整個溫潤起來，實為其創意木雕之代表作品之一，值得典藏。

